import React from "react";
import HEAD from "../assets/head.png";
export const Profile = () => {
  return (
    <div className="w-full bg-white py-16 text-white px-4">
      Profile
      <div className="max-w-[1240px] mx-auto grid md:grid-cols-2"></div>
      <img src={HEAD} alt="" />
      <div>
        <p className="text-black">Welcome to Dashboard</p>
        <h1>BIO</h1>
        <p>
          orem ipsum dolor sit amet consectetur adipisicing elit. Maxime
          mollitia, molestiae quas vel sint commodi repudiandae consequuntur
          voluptatum laborum numquam blanditiis harum quisquam eius sed odit
          fugiat iusto fuga praesentium optio, eaque rerum! Provident similique
          accusantium nemo autem. Veritatis obcaecati tenetur iure eius earum ut
          molestias architecto voluptate aliquam nihil, eveniet aliquid culpa
          officia aut! Impedit sit sunt quaerat, odit, tenetur error, harum
          nesciunt ipsum debitis quas aliquid.
        </p>
      </div>
    </div>
  );
};
export default Profile;
